import React, {useState} from "react";
import { Card } from "react-bootstrap";
import { useNavigate } from 'react-router-dom';
import axios from 'axios'


function UserRegistar(){
    const navigate = useNavigate();
    const navigateLogin=()=>{navigate("/login");}
    const url = "http://localhost:8080/api/v3/user"
    const [firstname, setFirstName] = useState('');
    const [lastname, setLastName] = useState('');
    const [uid,setUid] = useState('');
    const [pass, setPass] = useState('');
    const [error,setError] = useState({});
    var newError = {};

    const validate = () => {
        var isValid = true;
        //first name check
        if(!firstname){
            newError.firstnameError = "First name is required!";
            isValid = false;
        }
        else if(firstname.length < 3){
            newError.firstnameError = "First name must be atleast 3 characters long";
            isValid = false;
        }
        //last name check
        if(!lastname){
            newError.lastnameError = "Last name is required!";
            isValid = false;
        }
        //email check
        if(!mail){
            newError.emailError = "Email is required!";
            isValid = false;
        }
        else if(!mail.toString().includes("@")){
            newError.emailError = "Invalid email!";
            isValid = false;
        }
        //dob check
        if(!dob){
            newError.dobError = "Date of birth is required!";
            isValid = false;
        }
        //designation check
        if(!desig){
            newError.designationError = "Designation is required!";
            isValid = false;
        }
        //dept check
        if(!department){
            newError.deptError = "Department is required!";
            isValid = false;
        }
        //doj check
        if(!doj){
            newError.dojError = "Date of joining is required!";
            isValid = false;
        }
        return isValid;
    }


    // const handleSubmit = () => {
    //     console.log(firstname);
    //     console.log(lastname);
    //     if(firstname==="" || lastname==="" || uid=="" || pass=="")
    //     {
    //         alert("Please Fill All Fields");
    //     }
    //     else{
    //     axios.post(url,{firstName:firstname,lastName:lastname,id:uid,
    //     password:pass})
    //     .then(response => {
    //       console.log(response);
    //       if(response.data == 'sucess')
    //         navigate("/");
    //     })
    //     .catch(error=>{console.log(error)});
    //     console.log("sent");
    //     navigate("/login");
    //     alert("Data Submitted");}
    // }
    const handleSubmit = () => {
        setError(newError);
        // console.log(firstname);
        // console.log(lastname);
        //validate
        console.log(validate());
        // console.log(firstname);
        // console.log(lastname);
        // if(firstname==="" || lastname==="" || desig==="" || department==="" || mail==="" || dob==="" || doj==="")
        // {
        //     alert("Please Fill All Fields");
        // }
        // else{
        // axios.post(url,{firstName:firstname,lastName:lastname,id:username,designation:desig,
        // deparment:department,emailId:mail,dob:dob,doj:doj})
        // .then(response => {
        //   console.log(response);
        //   if(response.data == 'sucess')
        //     navigate("/admin");
        // })
        // .catch(error=>{console.log(error)});
        // console.log("sent");
        // alert("Data Submitted");}
        if(validate()){
            axios.post(url,{firstName:firstname,lastName:lastname,designation:desig,
            deparment:department,emailId:mail,dob:dob,doj:doj})
            .then(response => {
                console.log(response);
                if(response.data == 'sucess')
                    navigate("/login");
            })
            .catch(error=>{console.log(error)});
            console.log("sent");
            alert("Data Submitted");
        }
    }

        
    return(
    <div>
        <center>
            <Card>
                <Card.Title><h1>User Registration Form</h1></Card.Title><br/><br/>
                <form style={{"padding-left":"35%","padding-right":"35%", "padding-top":"2%"}}>
                    <div style={{"border":"1px solid black", "padding":"5% 5% 5%"}}>
                    <h3>User Registration</h3>
                    <br/>
                    <div class="form-outline mb-4 form-group">
                        <input type="text" id="fname" class="form-control"
                        onChange={(e)=>setFirstName(e.target.value)}
                         placeholder="Enter First Name" required/>
                    </div> 
                    <div class="form-outline mb-4 form-group">
                        <input type="text" id="lname" class="form-control" 
                        onChange={(e)=>setLastName(e.target.value)}
                        placeholder="Enter Last Name" required/>
                    </div>
                    <div class="form-outline mb-4 form-group">
                        <input type="text" id="uid" class="form-control" 
                        onChange={(e)=>setUid(e.target.value)}
                        placeholder="Enter User-ID" required/>
                    </div>
                    <div class="form-outline mb-4 form-group">
                        <input type="password" name="password" id="password" onChange={(e)=>setPass(e.target.value)}
                         class="form-control" placeholder="Enter Password" required/>
                    </div>
                    
                    <button type="button" class="btn btn-dark btn-block mb-4" onClick={handleSubmit} >Submit</button>
                    <div class="text-center">
                    <p>Already a member? <a href="/login">Login</a></p>
                    </div></div>
                </form>
            </Card>
            <br/>
        <br/>
        </center>
        
    </div>
    )
}

export default UserRegistar;
